import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import Home from './components/Home';
import Main from './components/main';

function App(props) {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route exact path="/" >
            <Home />
          </Route>
          <Route exact path="/join/:id" render={props => (
            <Main {...props}/>
          )} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
